        console.log(`bottomPad: ${this.props.bottomPad}`)
        return (
            <div className="App">
                <header className="App-content pb-400" style={{paddingBottom: this.props.bottomPad}}>
                    <a className="App-link"
                    href="https://jsongithub.github.io/portfolio/"
                    target="_self"
                    rel="noopener noreferrer"
                    >
                        portfolio
                    </a>
                    {/*<Lister items={[1,2,3]} />*/}
                    <Timer/>
                </header>
            </div>
        );
    };
}

export default Home;
